INSERT INTO tcat_discapacidades (id_discapacidad, t_discapacidad, descripcion) VALUES
(0, 'NINGUNA', 'El servidor público no tiene ninguna discapacidad'),
(1, 'DISCAPACIDAD FISICA', 'En la secuela o malformación que deriva de una afección en el sistema neuromuscular a nivel central o periferico, dando como resultado alteraciones en el control del movimiento y la postura, y que al interactuar con las barreras que le impone el entorno social, pueda impedir su inclusión plana y efectiva en la sociedad, en igualdad de condiciones con los demás.'),
(2, 'DISCAPACIDAD MENTAL', 'A la alteración o deficiencia en el sistema neuronal de una persona, que aunado a una sucesión de hechos que no puede manejar, detona un cambio en su comportamiento que dificulta su pleno desarrollo y convivencia social, y que al interactuar con las barreras que le impone el entorno social, puede impedir su inclusión plena y efectiva en la sociedad, en igualdad de condiciones con los demás.'),
(3, 'DISCAPACIDAD INTELECTUAL', 'Se caracteriza por limitaciones significativas tanto en la estructura del pensamiento razonado, como en la conducta adaptativa de la persona, y que al interactuar con las barreras que le impone el entodno social, pueda impedir su inclusión plena y efectiva en la sociedad, en igualdad de condiciones con los demás.'),
(4, 'DISCAPACIDAD SENSORIAL', 'Es la deficiencia estructural o funcional de los órganos de la visión, audición, tacto, olfato y gusto, así como de las estructuras y funciones asociadas a cada uno de ellos, y que al interactuar con las barreras que le impone el entorno social, pueda impedir su inclusión plena y efectiva en la sociedad, en igualdad de condiciones con los demás.');
